import React from 'react'
import Navbar from '../components/Navbar'
import home_img from '../media/home_img.png'
import '../styles/home.css'
import { CSSTransition } from 'react-transition-group';

export default function Home() {
  return (
    <div>
      <Navbar></Navbar>
      <div className='main'>
        <img src={home_img}/>
      </div>
      <Navbar></Navbar>
    </div>
  )
}
